/*Table structure for table `City` */

DROP TABLE IF EXISTS `City`;

CREATE TABLE `City` (
  `ID` char(32) NOT NULL COMMENT '系统->城市',
  `City` varchar(30) NOT NULL COMMENT '城市名',
  `Province` varchar(32) NOT NULL COMMENT '省市ID',
  `ShortPY` varchar(10) NOT NULL COMMENT '拼音首字母简称(sz.gz.bj.sh)',
  `FlagMap` tinyint(1) NOT NULL DEFAULT '0' COMMENT '地图使能',
  `CityNo` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '城市编号',
  `ChannelSale` tinyint(1) NOT NULL DEFAULT '0' COMMENT '二手房',
  `ChannelRent` tinyint(1) NOT NULL DEFAULT '0' COMMENT '租房',
  `ChannelTown` tinyint(1) NOT NULL DEFAULT '0' COMMENT '新盘',
  `TotalRent` int(11) unsigned NOT NULL COMMENT '总数-租',
  `TotalSale` int(11) unsigned NOT NULL COMMENT '总数-售',
  `TotalTown` int(11) unsigned NOT NULL COMMENT '总数-新盘',
  `TotalRefresh` datetime NOT NULL COMMENT '三个统计计数更新时间',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`City`),
  KEY `CityNo` (`CityNo`)
) ENGINE=InnoDB AUTO_INCREMENT=756 DEFAULT CHARSET=utf8 COMMENT='城市表';

