/*Table structure for table `CityLog` */

DROP TABLE IF EXISTS `CityLog`;

CREATE TABLE `CityLog` (
  `ID` varchar(10) NOT NULL COMMENT '系统->城市日志(包含区县及片区)',
  `CityID` char(32) NOT NULL COMMENT '城市ID',
  `City` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `LogTime` datetime NOT NULL COMMENT '日志时间',
  `Content` varchar(300) NOT NULL COMMENT '内容',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

