/*Table structure for table `Contract` */

DROP TABLE IF EXISTS `Contract`;

CREATE TABLE `Contract` (
  `ID` char(32) NOT NULL COMMENT '租售->租售托管订单',
  `ContractNo` char(20) NOT NULL COMMENT '订单编号(17位毫秒级时间戳+3随机数)',
  `StepCreate` datetime NOT NULL COMMENT '创建订单时间',
  `PropertyID` char(32) NOT NULL COMMENT '房源ID',
  `CustID` char(32) NOT NULL COMMENT '客户ID',
  `EmpID` char(32) NOT NULL COMMENT '经纪ID',
  `Status` enum('待支付','已支付','后台确认','申请结佣','已结佣','申请退款','已退款','异常','关闭') NOT NULL DEFAULT '待支付' COMMENT '订单状态',
  `Trade` enum('租','售') NOT NULL DEFAULT '租' COMMENT '租售',
  `Price` int(8) unsigned NOT NULL COMMENT '订单金额',
  `FeeCustomer` int(8) unsigned NOT NULL COMMENT '客户线上应付金额',
  `FeeCustomerAct` int(8) unsigned NOT NULL COMMENT '客户线上实付金额',
  `StepRefundGen` datetime DEFAULT NULL COMMENT '申请退款时间',
  `RefundReason` enum('拍错了','虚假房源','其它') DEFAULT '其它' COMMENT '退款原因',
  `StepRefundReach` datetime DEFAULT NULL COMMENT '达成退款时间',
  `RefundAct` int(10) unsigned NOT NULL COMMENT '实际退款金额',
  `AddClauses` varchar(500) DEFAULT NULL COMMENT '附加条款',
  `StepFeedback` datetime DEFAULT NULL COMMENT '申请结佣时间',
  `AcceptStaffID` char(32) DEFAULT NULL COMMENT '业绩确认伙伴ID',
  `StepClose` datetime DEFAULT NULL COMMENT '关闭交易时间',
  `StepPay` datetime DEFAULT NULL COMMENT '结佣',
  `PayStaffID` char(32) DEFAULT NULL COMMENT '结佣伙伴ID',
  `PayNote` varchar(50) DEFAULT NULL COMMENT '结佣备注',
  `FlagDeletedEmp` tinyint(1) NOT NULL COMMENT '获客经纪删除标识',
  `FlagDeletedCust` tinyint(1) NOT NULL COMMENT '客户删除标识',
  `FlagDeletedLeader` tinyint(4) DEFAULT NULL COMMENT '店长删除标志',
  `CommissionRatio` decimal(2,2) NOT NULL COMMENT '执行佣金比例',
  `BackFeeBank` varchar(20) DEFAULT NULL COMMENT '返佣银行，如中国银行',
  `BackFeeCode` varchar(30) DEFAULT NULL COMMENT '返佣账号',
  `BackFeeAccount` varchar(20) DEFAULT NULL COMMENT '返佣账户，如张三，××公司',
  `TradeWay` enum('微信','支付宝') NOT NULL COMMENT '支付途径',
  `TransactionID` char(32) DEFAULT NULL COMMENT '微信订单号',
  `OutTradeNo` char(64) DEFAULT NULL COMMENT '微信商户系统内部订单号',
  `TradeNo` char(64) DEFAULT NULL COMMENT '支付宝订单号',
  `CommodityOrderID` char(64) DEFAULT NULL COMMENT '支付宝商户订单ID号',
  `RefundID` char(64) DEFAULT NULL COMMENT '退款单号',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `ContractNo` (`ContractNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

