/*Table structure for table `ContractLog` */

DROP TABLE IF EXISTS `ContractLog`;

CREATE TABLE `ContractLog` (
  `ID` char(32) NOT NULL COMMENT '租售->租售托管订单日志',
  `ContractID` char(32) NOT NULL COMMENT '订单ID',
  `LogTime` datetime NOT NULL COMMENT '跟进时间',
  `Content` varchar(200) NOT NULL COMMENT '内容',
  PRIMARY KEY (`ID`),
  KEY `FK_FW_PRO` (`ContractID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单日志';

/*Data for the table `ContractLog` */

/*Table structure for table `Cust` */

DROP TABLE IF EXISTS `Cust`;

CREATE TABLE `Cust` (
  `ID` char(32) NOT NULL COMMENT '运营->平台注册用户',
  `Cust` varchar(50) DEFAULT NULL COMMENT '姓名',
  `CustNo` varchar(8) DEFAULT NULL COMMENT '编号',
  `Sex` enum('先生','女士','不详') NOT NULL DEFAULT '不详' COMMENT '性别',
  `Mobile` varchar(11) NOT NULL COMMENT '手机号',
  `Icon` varchar(200) DEFAULT NULL COMMENT '头像URL',
  `Pwd` char(32) NOT NULL DEFAULT '123456' COMMENT '登录密码',
  `Contact` varchar(50) DEFAULT NULL COMMENT '联系地址',
  `RegDate` datetime DEFAULT NULL COMMENT '注册日期',
  `Address` varchar(50) DEFAULT NULL COMMENT '住址',
  `Country` varchar(10) DEFAULT NULL COMMENT '国籍',
  `Email` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `Sign` varchar(50) DEFAULT NULL COMMENT '个性签名',
  `WXOpenID` char(30) DEFAULT NULL COMMENT '微信OpenID',
  `EmpStoreID` char(32) DEFAULT NULL COMMENT '专属顾问商户',
  `EmpStore` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`WXOpenID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='注册用户';

