/*Table structure for table `CustAppointResp` */

DROP TABLE IF EXISTS `CustAppointResp`;

CREATE TABLE `CustAppointResp` (
  `ID` char(32) NOT NULL COMMENT '运营->客户预约看房反馈',
  `CustID` char(32) NOT NULL COMMENT '客户ID',
  `AppointTime` datetime NOT NULL COMMENT '预约时间',
  `CustPositionJ` double DEFAULT NULL COMMENT '预约时客户经度(可填)',
  `CustPositionW` double DEFAULT NULL COMMENT '预约时客户纬度(可填)',
  `Type` enum('新盘','租售') NOT NULL DEFAULT '租售' COMMENT '类型',
  `EmpID` char(32) NOT NULL COMMENT '被预约经纪ID',
  `EstateID` char(32) NOT NULL COMMENT '预约小区ID',
  `PropertyID` char(32) DEFAULT NULL COMMENT '预约房源ID(可为空)',
  `RespTime` datetime DEFAULT NULL COMMENT '响应时间',
  `RespContent` varchar(20) DEFAULT NULL COMMENT '响应内容',
  `ExpectTime` varchar(20) DEFAULT NULL COMMENT '期待看房时间',
  `CustSay` varchar(50) DEFAULT NULL COMMENT '其它看房要求',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='客户预约看房反馈';

