  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `StaffID` char(32) NOT NULL COMMENT '伙伴ID，自动客服=32个0',
  `Staff` varchar(20) DEFAULT NULL COMMENT '伙伴(辅助)',
