/*Table structure for table `EmpCust` */

DROP TABLE IF EXISTS `EmpCust`;

CREATE TABLE `EmpCust` (
  `ID` char(32) NOT NULL COMMENT '商户->经纪人私客',
  `EmpID` char(32) DEFAULT NULL COMMENT '所属经纪ID(为空表示为公客)',
  `CustID` char(32) DEFAULT NULL COMMENT '客户ID，为空说明是自建客户',
  `Cust` varchar(20) NOT NULL COMMENT '客户记录名',
  `Sex` enum('先生','女士','不详') NOT NULL COMMENT '性别',
  `Mobile` char(11) DEFAULT NULL COMMENT '手机号',
  `Level` enum('A级(重要)','B级(一般)','C级(低价值)') DEFAULT NULL COMMENT '客户等级',
  `BudgetMax` int(10) unsigned NOT NULL COMMENT '核心意向-最大预算',
  `BudgetMin` int(10) unsigned NOT NULL COMMENT '核心意向-最小预算',
  `SquareMax` int(10) unsigned NOT NULL COMMENT '核心意向-最大面积',
  `SquareMin` int(10) unsigned NOT NULL COMMENT '核心意向-最小面积',
  `Layout` varchar(100) NOT NULL COMMENT '核心意向-户型',
  `Region` varchar(20) NOT NULL COMMENT '核心意向-区域',
  `CountW` int(1) NOT NULL COMMENT '核心意向-卫',
  `CustSource` enum('到店','微信群运营','线下广告','老客户推荐','客户名单','其它','待命名') DEFAULT NULL COMMENT '更多信息-客户来源',
  `Direction` enum('东','西','南','北','南北') DEFAULT NULL COMMENT '更多信息-朝向要求',
  `Decoration` enum('毛坯','简装','精装','豪装') DEFAULT NULL COMMENT '更多信息-装修要求',
  `Floor` enum('低','中','高','不要底','不要顶') DEFAULT NULL COMMENT '更多信息-楼层要求',
  `Elevator` enum('需要','不需要','均可') DEFAULT NULL COMMENT '更多信息-电梯要求',
  `Purchase` enum('刚需自住','改善','投资') DEFAULT NULL COMMENT '更多信息-购房目的',
  `Use` enum('住宅','商用') DEFAULT NULL COMMENT '更多信息-房屋用途',
  `Structure` enum('多层','高层','小高层','复式','跃层','独栋','双拼','联排') DEFAULT NULL COMMENT '更多信息-房屋结构',
  `Payment` enum('按揭贷款','一次付清') DEFAULT NULL COMMENT '更多信息-付款方式',
  `Identity` enum('老板','高管','白领','打工','个体户','公务员','工程师','自由职业') DEFAULT NULL COMMENT '更多信息-买家身份',
  `Amount` enum('无房产','1套房产','2套房产','3套及以上房产') DEFAULT NULL COMMENT '更多信息-名下房产',
  `Registered` enum('本地户口','外地户口') DEFAULT NULL COMMENT '更多信息-户口情况',
  `WX` varchar(20) DEFAULT NULL COMMENT '更多信息-微信号码',
  `Population` enum('1人','2人','3人','4人及以上') DEFAULT NULL COMMENT '更多信息-入住人口',
  `Marriage` enum('已婚','未婚') DEFAULT NULL COMMENT '更多信息-婚姻状况',
  `NewHouse` bit(1) DEFAULT NULL COMMENT '需求类型-新房',
  `Sale` bit(1) DEFAULT NULL COMMENT '需求类型-二手房',
  `Rent` bit(1) DEFAULT NULL COMMENT '需求类型-租房',
  `Describe` varchar(100) DEFAULT NULL COMMENT '私客描述信息',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='经纪人私客表';

