/*Table structure for table `Employee` */

DROP TABLE IF EXISTS `Employee`;

CREATE TABLE `Employee` (
  `ID` char(32) NOT NULL COMMENT '商户->经纪人',
  `EmpNo` int(6) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '编号',
  `Emp` varchar(10) NOT NULL COMMENT '经纪姓名',
  `Password` char(32) NOT NULL COMMENT '密码',
  `ThirdPWD` char(32) DEFAULT NULL COMMENT '第三方登录专用密码（群发工具）',
  `Tel` varchar(11) NOT NULL COMMENT '手机',
  `TelCard` char(11) DEFAULT NULL COMMENT '名片手机号码',
  `ContactInform` varchar(100) DEFAULT NULL COMMENT '其他联系方式',
  `Status` enum('正常','申请合作','加入等待','异常') NOT NULL DEFAULT '正常' COMMENT '状态',
  `Sex` enum('男','女','不详') NOT NULL DEFAULT '不详' COMMENT '性别',
  `IDCard` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `EMail` varchar(100) DEFAULT NULL COMMENT '注册邮箱',
  `Signer` varchar(50) DEFAULT NULL COMMENT '个性签名',
  `Icon` varchar(200) DEFAULT NULL COMMENT '头像URL',
  `IconTime` datetime DEFAULT NULL COMMENT '头像修改时间',
  `WXNo` varchar(30) DEFAULT NULL COMMENT '微信号',
  `WXOpenID` varchar(30) DEFAULT NULL COMMENT '微信OpenID',
  `StoreID` char(32) DEFAULT NULL COMMENT '所属商户ID',
  `Store` varchar(30) DEFAULT NULL COMMENT '（辅助）',
  `StoreManage` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否=商户管理员(0=否1=是)',
  `AuthState` enum('已认证','未认证','认证中') NOT NULL DEFAULT '未认证' COMMENT '账户实名状态',
  `Feature` varchar(25) DEFAULT NULL COMMENT '性格特点（下划线隔开，最多4个，每个最多5字）',
  `FeatureModTime` datetime DEFAULT NULL COMMENT '经纪人性格特点修改时间',
  `MassValidity` date DEFAULT NULL COMMENT '推房付费账户有效期',
  `MassType` enum('视频版','青英版','免费版') NOT NULL DEFAULT '免费版' COMMENT '推房账户类别',
  `MassQuota` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '发布配额',
  `MassStock` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '最大库存',
  `CityID` varchar(32) DEFAULT NULL COMMENT '城市ID',
  `CityName` varchar(30) DEFAULT NULL COMMENT '城市名称',
  `Score` int(11) DEFAULT NULL COMMENT '积分',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `唯一` (`EmpNo`,`WXOpenID`)
) ENGINE=InnoDB AUTO_INCREMENT=75596086 DEFAULT CHARSET=utf8 COMMENT='经纪人';

