/*Table structure for table `EstateCorrect` */

DROP TABLE IF EXISTS `EstateCorrect`;

CREATE TABLE `EstateCorrect` (
  `ID` char(32) NOT NULL COMMENT '租售->小区信息纠错',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `EstateID` char(32) NOT NULL COMMENT '小区ID',
  `EstateName` varchar(10) DEFAULT NULL COMMENT '小区名(辅助)',
  `Item` varchar(20) NOT NULL COMMENT '项',
  `Content` varchar(50) NOT NULL COMMENT '内容',
  `Presenter` varchar(32) NOT NULL COMMENT '提出者标识 (经纪人填ID) 和项，内容同时唯一',
  PRIMARY KEY (`ID`),
  KEY `FK_ESTATE_AREA` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区表';

