/*Table structure for table `EstateFind` */

DROP TABLE IF EXISTS `EstateFind`;

CREATE TABLE `EstateFind` (
  `ID` char(32) NOT NULL COMMENT '租售->小区发现',
  `CityID` char(32) NOT NULL COMMENT '城市ID',
  `EmpID` char(32) NOT NULL COMMENT '创建经纪ID',
