/*Table structure for table `EstateHistory` */

DROP TABLE IF EXISTS `EstateHistory`;

CREATE TABLE `EstateHistory` (
  `ID` char(32) NOT NULL COMMENT '租售->小区历史单价',
  `EstateID` char(32) NOT NULL COMMENT '小区ID',
  `Estate` varchar(20) DEFAULT NULL COMMENT '（辅助，如深圳公园大地）',
