/*Table structure for table `EstateImageStorage` */

DROP TABLE IF EXISTS `EstateImageStorage`;

CREATE TABLE `EstateImageStorage` (
  `ID` char(32) NOT NULL COMMENT '租售->小区图（仓储）',
  `City` varchar(10) DEFAULT NULL COMMENT '城市',
  `Estate` varchar(32) NOT NULL COMMENT '小区',
  `AddTime` datetime NOT NULL COMMENT '上传时间',
  `Path` varchar(200) NOT NULL COMMENT 'URL',
  `Source` varchar(10) DEFAULT NULL COMMENT '来源（如：安居客）',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区图https://img.ekeae.com';

