/*Table structure for table `EstateLog` */

DROP TABLE IF EXISTS `EstateLog`;

CREATE TABLE `EstateLog` (
  `ID` char(32) NOT NULL COMMENT '租售->小区日志',
  `EstateID` char(32) NOT NULL COMMENT '小区ID',
  `LogTime` datetime NOT NULL COMMENT '日志时间',
  `StaffID` char(32) DEFAULT NULL COMMENT '伙伴ID',
  `Staff` varchar(20) DEFAULT NULL COMMENT '伙伴',
  `Content` varchar(200) NOT NULL COMMENT '内容',
  PRIMARY KEY (`ID`),
  KEY `FK_FW_PRO` (`EstateID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区日志';

