/*Table structure for table `EstateMatch` */

DROP TABLE IF EXISTS `EstateMatch`;

CREATE TABLE `EstateMatch` (
  `ID` char(32) NOT NULL COMMENT '租售->小区匹配表',
  `MatchNo` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '匹配编号',
  `EstateID` char(32) NOT NULL COMMENT '小区ID',
  `WebID` char(32) NOT NULL COMMENT '网站ID',
  `Name` varchar(50) DEFAULT NULL COMMENT '对应网站小区名',
  `CreateTime` date NOT NULL COMMENT '创建时间',
  `ModifyTime` date DEFAULT NULL COMMENT '修改时间',
  `Remark` varchar(50) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `MatchNo` (`MatchNo`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='小区默认匹配其他网站小区名表';

