/*Table structure for table `HouseTypeImageEmp` */

DROP TABLE IF EXISTS `HouseTypeImageEmp`;

CREATE TABLE `HouseTypeImageEmp` (
  `ID` char(32) NOT NULL COMMENT '租售->房型图（经纪人）https://img.ekeae.com',
  `EstateID` char(32) NOT NULL DEFAULT '0' COMMENT '小区ID',
  `HouseID` char(32) NOT NULL COMMENT '房源ID',
  `CountF` int(1) NOT NULL DEFAULT '0' COMMENT '户型数',
  `City` varchar(10) DEFAULT NULL COMMENT '（辅助）',
  `Estate` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `AddTime` datetime NOT NULL COMMENT '加入时间',
  `OperatorID` char(32) NOT NULL COMMENT '上传人ID',
  `Filename` varchar(100) NOT NULL COMMENT '文件名',
  `Size` int(8) unsigned NOT NULL COMMENT '大小(KB)',
  `Path` varchar(200) NOT NULL COMMENT 'URL',
  `FlagDeleted` tinyint(1) DEFAULT NULL COMMENT '删除标志',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区图https://img.ekeae.com';

