/*Table structure for table `Inspect` */

DROP TABLE IF EXISTS `Inspect`;

CREATE TABLE `Inspect` (
  `ID` char(32) NOT NULL COMMENT '运营->后台检查日志（二）',
  `InspectTime` datetime NOT NULL COMMENT '检查时间',
  `StaffID` char(32) NOT NULL COMMENT '伙伴ID',
  `Tpye` enum('房源封面','房源图') NOT NULL,
  `Remark` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='后台检查日志';

/*Data for the table `Inspect` */

/*Table structure for table `MassBind` */

DROP TABLE IF EXISTS `MassBind`;

CREATE TABLE `MassBind` (
  `ID` char(32) NOT NULL COMMENT '推房->第三方账户绑定（每网站最多三个账户）',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Platform` varchar(32) NOT NULL COMMENT '第三方网站',
  `Account` varchar(50) NOT NULL COMMENT '账户',
  `Pwd` varchar(50) NOT NULL COMMENT '账户密码',
  `AccountMes` varchar(30) DEFAULT NULL COMMENT '账户附加信息（部分网站使用，下划线隔开）',
  `CheckAvailable` tinyint(1) NOT NULL DEFAULT '1' COMMENT '后台可用性检查（0=异常，1=正常）',
  `CheckMes` varchar(20) DEFAULT NULL COMMENT '后台可用性检查提示信息',
  `Remark` varchar(500) DEFAULT NULL COMMENT '存储加密密码',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

