/*Table structure for table `MassEmpImg` */

DROP TABLE IF EXISTS `MassEmpImg`;

CREATE TABLE `MassEmpImg` (
  `ID` char(32) NOT NULL COMMENT '推房->经纪人图库',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Remark` varchar(20) DEFAULT NULL,
