/*Data for the table `MassEmpImg` */

/*Table structure for table `MassEmpLayout` */

DROP TABLE IF EXISTS `MassEmpLayout`;

CREATE TABLE `MassEmpLayout` (
  `ID` char(32) NOT NULL COMMENT '推房->经纪人户型图仓库',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Layout` varchar(500) NOT NULL COMMENT '户型图URL',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEmpLayout` */

/*Table structure for table `MassEmpPay` */

DROP TABLE IF EXISTS `MassEmpPay`;

CREATE TABLE `MassEmpPay` (
  `ID` char(32) NOT NULL COMMENT '推房->经纪人续费流水',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Type` varchar(20) NOT NULL COMMENT '购买会员类型',
  `BuyDuration` varchar(10) DEFAULT NULL COMMENT '购买时长(季付，半年付，年付)',
  `PayTime` datetime NOT NULL COMMENT '订单时间',
  `EndTime` datetime DEFAULT NULL COMMENT '预计到期时间',
  `PayType` int(1) DEFAULT NULL COMMENT '支付方式(0=微信1=支付宝)',
  `PaySet` double(10,0) unsigned NOT NULL COMMENT '订单金额',
  `PayAct` double(10,0) unsigned NOT NULL COMMENT '需付金额',
  `PayResult` int(1) NOT NULL DEFAULT '0' COMMENT '支付状态(0=待支付1=支付成功2=订单取消3=订单超时)',
  `Remark` varchar(1000) DEFAULT NULL COMMENT '支付接口返回内容',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

