/*Table structure for table `MassEmpSet` */

DROP TABLE IF EXISTS `MassEmpSet`;

CREATE TABLE `MassEmpSet` (
  `ID` char(32) NOT NULL COMMENT '推房->房源',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Old` tinyint(1) NOT NULL COMMENT '允许推送满时删除一条旧房源再发布的网站',
  `Repeat` enum('不发送','先删除后发送','强制发送') NOT NULL COMMENT '网站房源重复发送处理设置:（预约发布时，统一为先删除后发送）',
  `Days` int(1) unsigned NOT NULL COMMENT '发布房源至58时，默认推广天数',
  `Top` tinyint(1) NOT NULL COMMENT '安居客、58 非手机标签发布，默认不删除精推和置顶房源',
  `DesignSketch` tinyint(1) NOT NULL COMMENT '推送房源时，是否在房源图片上加入‘效果图’水印',
  `Mentality` tinyint(1) NOT NULL COMMENT '发布房源时，房源描述后面增加业主心态等信息',
  `Dynamic` tinyint(1) NOT NULL COMMENT '发布房源时，使用动态封面图(新浪网)',
  `Contact` tinyint(1) NOT NULL COMMENT '发布房源至58(付费端口)，使用小蜜书的手机号和姓名作为联系方式',
  `Release` tinyint(1) NOT NULL COMMENT '排班发布-禁止加入',
  `Refresh` tinyint(1) NOT NULL COMMENT '排班刷新-禁止加入',
  `Quick` enum('支持所有站点','仅支持公司站点') NOT NULL COMMENT '秒录站点',
  `Watermark` tinyint(1) NOT NULL COMMENT '水 印',
  `Transparency` float NOT NULL COMMENT '透明度',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEmpSet` */

/*Table structure for table `MassEmpWatermark` */

DROP TABLE IF EXISTS `MassEmpWatermark`;

CREATE TABLE `MassEmpWatermark` (
  `ID` char(32) NOT NULL COMMENT '推房->经纪人水印库',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEmpWatermark` */

/*Table structure for table `MassEstateHabit` */

DROP TABLE IF EXISTS `MassEstateHabit`;

CREATE TABLE `MassEstateHabit` (
  `ID` varchar(50) NOT NULL COMMENT '推房->常用小区名（房源录入时用）',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEstateHabit` */

/*Table structure for table `MassEstateXray` */

DROP TABLE IF EXISTS `MassEstateXray`;

CREATE TABLE `MassEstateXray` (
  `ID` varchar(50) NOT NULL COMMENT '推房->小区透视房源采集（采集时间毫秒级）',
  `Site` enum('58同城','房天下','搜房网','安居客') NOT NULL COMMENT '网站',
  `PropertyNo` varchar(20) NOT NULL COMMENT '房源房源编号',
  `Room` varchar(20) NOT NULL COMMENT '户型',
  `Floor` varchar(20) NOT NULL COMMENT '楼层',
  `Square` varchar(20) NOT NULL COMMENT '面积',
  `Register` varchar(20) NOT NULL COMMENT '入库时间',
  `PropertyUrl` varchar(200) NOT NULL COMMENT '房源地址',
  `Company` varchar(20) DEFAULT NULL COMMENT '经纪公司',
  `Emp` varchar(20) DEFAULT NULL COMMENT '经纪人',
  `Title` varchar(50) DEFAULT NULL COMMENT '标题',
  `Category` varchar(32) DEFAULT NULL COMMENT '分类ID',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEstateXray` */

/*Table structure for table `MassEstateXrayCategory` */

DROP TABLE IF EXISTS `MassEstateXrayCategory`;

CREATE TABLE `MassEstateXrayCategory` (
  `ID` char(32) NOT NULL COMMENT '推房->小区透视分类',
  `Site` enum('58同城','房天下','搜房网','安居客') NOT NULL COMMENT '网站',
  `PropertyNo` varchar(20) NOT NULL COMMENT '房源房源编号',
  `Room` varchar(20) NOT NULL COMMENT '户型',
  `Floor` varchar(20) NOT NULL COMMENT '楼层',
  `Square` varchar(20) NOT NULL COMMENT '面积',
  `Register` varchar(20) NOT NULL COMMENT '登记时间',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEstateXrayCategory` */

/*Table structure for table `MassEstateXrayLog` */

DROP TABLE IF EXISTS `MassEstateXrayLog`;

CREATE TABLE `MassEstateXrayLog` (
  `ID` char(32) NOT NULL COMMENT '推房->小区透视经纪人使用量',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `Request` varchar(20) NOT NULL COMMENT '调用时间',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

/*Data for the table `MassEstateXrayLog` */

/*Table structure for table `MassHouse` */

DROP TABLE IF EXISTS `MassHouse`;

CREATE TABLE `MassHouse` (
  `ID` varchar(32) NOT NULL COMMENT '房源录入->住宅表',
  `HouseType` varchar(20) DEFAULT NULL COMMENT '房屋类别',
  `HouseSubType` varchar(20) DEFAULT NULL COMMENT '住宅子类型',
  `HouseProperty` varchar(20) DEFAULT NULL COMMENT '房屋产权',
  `LandYear` varchar(20) DEFAULT NULL COMMENT '产权年限',
  `HouseStructure` varchar(20) DEFAULT NULL COMMENT '房屋结构',
  `HouseYear` int(20) DEFAULT NULL COMMENT '房屋年限(0=满两年1=满五年2=不满两年)',
  `OnlyHouse` int(1) DEFAULT NULL COMMENT '是否唯一住房(0=否1=是)',
  `BasicEquip` varchar(100) DEFAULT NULL COMMENT '基础设施(逗号隔开)',
  `AdvEquip` varchar(100) DEFAULT NULL COMMENT '配套设施(逗号隔开)',
  PRIMARY KEY (`ID`)
