/*Table structure for table `MassNotice` */

DROP TABLE IF EXISTS `MassNotice`;

CREATE TABLE `MassNotice` (
  `ID` char(32) NOT NULL COMMENT '推房->公告原文',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime NOT NULL COMMENT '修改时间',
  `NoticeNo` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '公告编号',
  `Title` varchar(50) NOT NULL COMMENT '标题',
  `Content` text NOT NULL COMMENT '内容',
  `Type` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '0=系统公告，1=网站公告，2=客户公告，3=公司公告，4=站内信息',
  `StaffID` varchar(32) DEFAULT NULL COMMENT '创建人',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `NoticeNo` (`NoticeNo`)
) ENGINE=InnoDB AUTO_INCREMENT=393 DEFAULT CHARSET=utf8 COMMENT='房源表';

