/*Table structure for table `MassNoticeEmp` */

DROP TABLE IF EXISTS `MassNoticeEmp`;

CREATE TABLE `MassNoticeEmp` (
  `ID` char(32) NOT NULL COMMENT '推房->公告分发明细',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `NoticeID` char(32) NOT NULL COMMENT '公告ID',
  `EmpID` char(32) NOT NULL COMMENT '接受人(emp)',
  `StaffID` char(32) NOT NULL COMMENT '发送人(staff)',
  `State` tinyint(1) NOT NULL DEFAULT '0' COMMENT '查看状态(0=待阅，1=已阅)',
  `ReceiveTime` datetime DEFAULT NULL COMMENT '查看时间',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

