/*Table structure for table `MassPersonBuyWant` */

DROP TABLE IF EXISTS `MassPersonBuyWant`;

CREATE TABLE `MassPersonBuyWant` (
  `ID` char(32) NOT NULL COMMENT '推房->个人求购',
  `CollectDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '采集时间（当前）',
  `Site` varchar(20) NOT NULL COMMENT '网站',
  `City` varchar(20) NOT NULL COMMENT '城市',
  `District` varchar(20) NOT NULL COMMENT '区县',
  `Area` varchar(20) DEFAULT NULL COMMENT '片区',
  `Estate` varchar(20) NOT NULL COMMENT '小区',
  `Title` varchar(40) NOT NULL COMMENT '标题',
  `Type` varchar(255) DEFAULT NULL COMMENT '类型',
  `Square` decimal(4,0) DEFAULT '1' COMMENT '面积',
  `CountF` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '房',
  `CountT` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '厅',
  `CountW` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '卫',
  `Img` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '图数',
  `Price` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '大致金额（万）',
  `RegDate` varchar(20) DEFAULT NULL COMMENT '原房源时间（网站）',
  `RegName` varchar(10) DEFAULT NULL COMMENT '登记人姓名',
  `RegTel` varchar(50) DEFAULT NULL COMMENT '登记人电话',
  `DetailPath` varchar(200) NOT NULL COMMENT '详情URL(重复比对关键字)',
  `FlagDeleted` tinyint(1) DEFAULT NULL COMMENT '删除标识',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

