/*Table structure for table `MassPersonSaleEmpCondi` */

DROP TABLE IF EXISTS `MassPersonSaleEmpCondi`;

CREATE TABLE `MassPersonSaleEmpCondi` (
  `ID` char(32) NOT NULL COMMENT '推房->经纪人检索条件(个人出售)一个人最多10条记录',
  `EmpID` char(32) NOT NULL COMMENT '经纪人ID',
  `AddTime` datetime NOT NULL COMMENT '添加时间',
  `Site` varchar(20) DEFAULT NULL COMMENT '网站（单选）',
  `Sites` varchar(100) DEFAULT NULL COMMENT '网站（多选）',
  `District` varchar(200) DEFAULT NULL COMMENT '区县ID（多选）--字段名少了一个ID后面再说',
  `Districts` varchar(100) DEFAULT NULL COMMENT '区县（多选）',
  `AreaID` varchar(200) DEFAULT NULL COMMENT '片区ID（多选）',
  `Area` varchar(100) DEFAULT NULL COMMENT '片区（多选）',
  `Type` varchar(20) DEFAULT NULL COMMENT '类型',
  `KeyWord` varchar(20) DEFAULT NULL COMMENT '关键字',
  `CountF` int(1) unsigned DEFAULT NULL COMMENT '房数',
  `PriceMax` int(5) unsigned DEFAULT NULL COMMENT '最大价格',
  `PriceMin` int(5) unsigned DEFAULT NULL COMMENT '最小价格',
  `SizeMax` int(5) unsigned DEFAULT NULL COMMENT '最大面积',
  `SizeMin` int(5) unsigned DEFAULT NULL COMMENT '最小面积',
  `Def` tinyint(1) NOT NULL DEFAULT '0' COMMENT '缺省（0=否，1=是）',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

