  `Address` varchar(50) DEFAULT NULL COMMENT '小区地址',
  `BuildingType` int(10) DEFAULT NULL COMMENT '栋座类型(1=栋2=弄3座4=号5=号楼6=胡同)',
  `BuildingValue` varchar(20) DEFAULT NULL COMMENT '栋座值',
  `UnitType` int(10) DEFAULT NULL COMMENT '单元类型(1=栋2=幢3=号4=号楼5=单元)',
