  `CountT` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '厅',
  `CountW` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '卫',
  `CountC` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '厨',
  `CountY` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '阳',
  `DdlUsedYear` int(4) DEFAULT NULL COMMENT '建造年代',
  `Usage` enum('住宅','别墅','商铺','写字楼','厂房') NOT NULL DEFAULT '住宅' COMMENT '物业用途',
  `Direction` enum('东','南','西','北','东北','西南','东南','西北','不详','东西','南北') DEFAULT '南' COMMENT '朝向',
  `Look` enum('随时看房','非工作时间','电话预约','其它') DEFAULT '电话预约' COMMENT '看房方式',
  `Decoration` enum('豪华装修','精装修','中等装修','简装修','毛坯') DEFAULT '中等装修' COMMENT '装修程度',
  `SquareJ` decimal(4,1) NOT NULL COMMENT '建筑面积',
  `SquareS` int(4) unsigned NOT NULL COMMENT '使用面积',
  `RentPrice` int(8) unsigned DEFAULT '0' COMMENT '租金',
  `HouseLabel` varchar(50) DEFAULT NULL COMMENT '房源标签(空格隔开，最多6个，2-5字)',
  `CellLabel` varchar(50) DEFAULT NULL COMMENT '配套标签(空格隔开，最多4个，2-5字)',
  `Floor` int(2) unsigned DEFAULT '0' COMMENT '所在层',
  `FloorAll` int(2) unsigned DEFAULT '0' COMMENT '总楼层',
  `HeadImgPath` varchar(200) DEFAULT NULL COMMENT '封面URL',
  `FlagSublet` tinyint(1) NOT NULL DEFAULT '0' COMMENT '租赁方式(分租,0=整租1=分租)',
  `SubletNumber` int(1) DEFAULT '2' COMMENT '几户合租(分租)',
  `SubletCondition` enum('性别不限','限女生','限男生','限夫妻') DEFAULT '性别不限' COMMENT '条件(分租)',
  `SubletRoom` enum('主卧','次卧','床位','隔断间','其它') DEFAULT '主卧' COMMENT '房型(分租)',
  `SubletPayType` enum('押一付一','押一付二','押一付三','押二付一','押二付二','押二付三','押三付一','押三付二','押三付三','半年付','年付','面议') DEFAULT '押一付一' COMMENT '支付方式(分租)',
  `FlagDeleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除标识(0=否1=是)',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `FeeCust` decimal(6,2) DEFAULT NULL COMMENT '承诺客户佣金',
  `SourceType` int(2) DEFAULT NULL COMMENT '房源来源',
  `FlagVideo` tinyint(1) DEFAULT '0' COMMENT '是否视频(1=是0=否)',
  `FlagMoreImage` tinyint(1) DEFAULT '0' COMMENT '是否多图(1=是0=否)',
  `FeatureModTime` datetime DEFAULT NULL COMMENT '特点修改时间',
  `ViewTimes` int(6) unsigned DEFAULT '0' COMMENT '查看次数（定时统计）',
  `ModifyTime` datetime DEFAULT NULL COMMENT '房库修改时间',
  `SendTime` datetime DEFAULT NULL COMMENT '推送时间',
  `InternalNum` varchar(50) NOT NULL COMMENT '内部编号',
  `FileNo` varchar(50) DEFAULT NULL COMMENT '备案编号',
  `CityID` varchar(32) DEFAULT NULL COMMENT '城市ID',
  `CityName` varchar(30) DEFAULT NULL COMMENT '城市名称',
  `DistrictID` varchar(32) DEFAULT NULL COMMENT '区县ID',
  `DistrictName` varchar(30) DEFAULT NULL COMMENT '区县名称',
  `AreaID` varchar(32) DEFAULT NULL COMMENT '片区ID',
  `AreaName` varchar(30) DEFAULT NULL COMMENT '片区名称',
  `Title` varchar(40) DEFAULT NULL COMMENT '标题',
  `Description` text COMMENT '信息描述',
  `Mentality` varchar(400) DEFAULT NULL COMMENT '业主心态',
  `Environment` varchar(400) DEFAULT NULL COMMENT '小区配套',
  `Serve` varchar(400) DEFAULT NULL COMMENT '服务介绍',
  `Taxation` varchar(400) DEFAULT NULL COMMENT '税费信息',
  `EmpFollowSay` varchar(300) DEFAULT NULL COMMENT '经纪人推荐词',
  `Remark` varchar(200) DEFAULT NULL COMMENT '业主其它联系方式等可以放在这里',
  PRIMARY KEY (`ID`),
  KEY `PropertyNo` (`PropertyNo`),
  KEY `FK_P_ESTATE` (`EstateID`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='房源表';

