/*Table structure for table `NewsHead` */

DROP TABLE IF EXISTS `NewsHead`;

CREATE TABLE `NewsHead` (
  `ID` char(32) NOT NULL COMMENT '运营->楼讯',
  `NewsHeadNo` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `Status` enum('展示','下线','待审') NOT NULL DEFAULT '待审' COMMENT '状态',
  `Title` varchar(50) NOT NULL COMMENT '标题',
  `Source` varchar(20) DEFAULT NULL COMMENT '来源',
  `StaffID` char(32) NOT NULL COMMENT '登记人ID',
  `RegDate` datetime NOT NULL COMMENT '登记时间',
  `ShowDate` datetime NOT NULL COMMENT '显示时间',
  `CoverPath` varchar(200) NOT NULL COMMENT '封面路径',
  `Content` text NOT NULL COMMENT '内容HTML',
  `FlagTop` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否置顶(0否1是)',
  `ViewCount` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '查看次数',
  `ShareCount` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '分享次数',
