  `Sort` int(11) unsigned NOT NULL DEFAULT '99' COMMENT '排序',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `FK_NEWS_STAFF` (`StaffID`),
  KEY `NewsHeadNo` (`NewsHeadNo`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='新闻表';

