/*Table structure for table `NewsHeadCorrect` */

DROP TABLE IF EXISTS `NewsHeadCorrect`;

CREATE TABLE `NewsHeadCorrect` (
  `ID` char(32) NOT NULL COMMENT '运营->楼讯反馈（版权争议专用）',
  `NewsHeadID` char(32) DEFAULT NULL COMMENT '楼讯ID',
  `NewsHead` varchar(50) DEFAULT NULL COMMENT '楼讯标题（辅助）',
  `RevTime` datetime NOT NULL COMMENT '提交时间',
  `Way` enum('经纪端','客户端','官网','其它') NOT NULL DEFAULT '经纪端' COMMENT '来源',
  `UserID` char(32) NOT NULL COMMENT '经纪or客户ID',
  `Content` varchar(100) NOT NULL COMMENT '值',
  `StaffID` char(32) DEFAULT NULL COMMENT '处理人ID',
  `StaffTime` datetime DEFAULT NULL COMMENT '处理时间',
  `StaffNote` varchar(20) DEFAULT NULL COMMENT '处理留言',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `FK_COMPLAINT_STAFF` (`StaffID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区信息勘误表';

/*Data for the table `NewsHeadCorrect` */

/*Table structure for table `NewsHeadLog` */

DROP TABLE IF EXISTS `NewsHeadLog`;

CREATE TABLE `NewsHeadLog` (
  `ID` char(32) NOT NULL COMMENT '运营->楼讯修改日志',
  `NewsHeadID` char(32) NOT NULL COMMENT '楼讯ID',
  `EditID` varchar(32) NOT NULL COMMENT '修改人(Staff)',
  `LogTime` datetime NOT NULL COMMENT '日志时间',
  `Content` varchar(200) NOT NULL COMMENT '内容',
  PRIMARY KEY (`ID`),
  KEY `FK_FW_PRO` (`NewsHeadID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区日志';

