/*Table structure for table `NewsHeadShare` */

DROP TABLE IF EXISTS `NewsHeadShare`;

CREATE TABLE `NewsHeadShare` (
  `ID` char(32) NOT NULL COMMENT '运营->楼讯分享（软文营销）',
  `NewsHeadID` char(32) NOT NULL COMMENT '楼讯ID',
  `NewsHead` varchar(50) DEFAULT NULL COMMENT '楼讯标题（辅助）',
  `ShareTime` datetime NOT NULL COMMENT '分享时间',
  `ShareTo` varchar(20) DEFAULT NULL COMMENT '分享方式（微信、QQ、朋友圈）',
  `Way` enum('经纪端','客户端','官网','其它') NOT NULL DEFAULT '经纪端' COMMENT '发起端',
  `UserID` char(32) NOT NULL COMMENT '经纪or客户ID',
  `PropertyID` char(32) DEFAULT NULL COMMENT '房源ID（经纪人软文营销专用）',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `FK_COMPLAINT_STAFF` (`PropertyID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区信息勘误表';

