/*Table structure for table `NewsHeadStore` */

DROP TABLE IF EXISTS `NewsHeadStore`;

CREATE TABLE `NewsHeadStore` (
  `ID` char(32) NOT NULL COMMENT '运营->楼讯',
  `ShowWay` enum('经纪端','客户端') NOT NULL COMMENT '展示平台',
  `RegDate` datetime NOT NULL COMMENT '存入时间',
  `Type` varchar(20) DEFAULT NULL COMMENT '类型',
  `Title` varchar(50) NOT NULL COMMENT '标题',
  `Source` varchar(20) DEFAULT NULL COMMENT '来源',
  `ShowDate` varchar(20) NOT NULL DEFAULT '2019-01-01' COMMENT '显示时间(字符串格式)',
  `CoverPath` varchar(200) NOT NULL COMMENT '封面路径',
  `Content` varchar(5000) NOT NULL COMMENT '内容',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新闻表';

/*Data for the table `NewsHeadStore` */

/*Table structure for table `NewsHeadView` */

DROP TABLE IF EXISTS `NewsHeadView`;

CREATE TABLE `NewsHeadView` (
  `ID` char(32) NOT NULL COMMENT '运营->新闻查看次数',
  `NewsHeadID` char(32) NOT NULL COMMENT '新闻ID',
  `Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '查看时间',
  PRIMARY KEY (`ID`),
  KEY `FK_P_ESTATE` (`NewsHeadID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源查看(次数)表';

/*Data for the table `NewsHeadView` */

/*Table structure for table `NewsPopup` */

DROP TABLE IF EXISTS `NewsPopup`;

CREATE TABLE `NewsPopup` (
  `ID` char(32) NOT NULL COMMENT '新闻->移动端弹屏原文',
  `RevType` enum('经纪端','客户端') NOT NULL DEFAULT '经纪端' COMMENT '接收端类型',
  `Title` varchar(50) NOT NULL COMMENT '标题',
  `NewsPopupNo` int(4) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '编号',
