/*Table structure for table `OMCDR` */

DROP TABLE IF EXISTS `OMCDR`;

CREATE TABLE `OMCDR` (
  `ID` char(32) NOT NULL COMMENT '系统->呼叫详细记录报告/话单(CDR)',
  `CdrID` char(32) NOT NULL COMMENT '通单id，用于关联多个cdr,无关联时为Null',
  `CallID` int(11) unsigned NOT NULL COMMENT '通话唯一标识符',
  `visitorID` int(11) unsigned NOT NULL COMMENT '来电标识号，内部分机通话记录无此字段',
  `OuterID` int(11) unsigned NOT NULL COMMENT '去电标识号，内部分机通话记录无此字段',
  `Type` enum('IN','OU','CB') NOT NULL COMMENT 'IN（打入）/OU（打出）/FI（呼叫转移入）/FW（呼叫转移出）/LO（内部通话）/CB（双向外呼）',
  `Route` enum('IP','XO','OP') NOT NULL COMMENT 'IP（IP中继）/XO（模拟中继）/IC（内部）/OP（总机）',
  `TimeStart` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '呼叫起始时间，即发送或收到呼叫请求的时间',
  `TimeEnd` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '呼叫结束时间，即通话的一方挂断的时间',
  `CPN` varchar(20) NOT NULL COMMENT '主叫号码',
  `CDPN` varchar(20) NOT NULL COMMENT '被叫号码',
