/*Table structure for table `Property` */

DROP TABLE IF EXISTS `Property`;

CREATE TABLE `Property` (
  `ID` char(32) NOT NULL COMMENT '租售->房源',
  `MassDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发送时间',
  `FlagDeleted` tinyint(1) DEFAULT NULL COMMENT '删除标识',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `ViewTimes` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '查看次数（定时统计）',
  `SortScore` int(10) unsigned NOT NULL COMMENT '排序分数(排序依据)',
  `MassPropertyType` int(1) DEFAULT NULL COMMENT '房库类型(0=售1=租)',
  `MassPropertyID` varchar(32) DEFAULT NULL COMMENT '房库ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源表';

