/*Table structure for table `PropertyCustSay` */

DROP TABLE IF EXISTS `PropertyCustSay`;

CREATE TABLE `PropertyCustSay` (
  `ID` char(32) NOT NULL COMMENT '租售->房源客户评论',
  `PropertyID` char(32) NOT NULL COMMENT '房源ID',
  `CustID` char(32) NOT NULL COMMENT '客户ID',
  `Check` enum('待核','展示','忽略') NOT NULL COMMENT '状态',
