  `CheckSay` varchar(50) DEFAULT NULL COMMENT '回应内容',
  `CheckEmpID` char(32) DEFAULT NULL COMMENT '回应经纪ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源客户评论表';

