/*Table structure for table `PropertyImage` */

DROP TABLE IF EXISTS `PropertyImage`;

CREATE TABLE `PropertyImage` (
  `ID` char(32) NOT NULL COMMENT '租售->房源图https://img.ekeae.com',
  `PropertyID` char(32) NOT NULL DEFAULT '0' COMMENT '房源ID',
  `UploadTime` datetime NOT NULL COMMENT '上传时间',
  `EmpID` char(32) NOT NULL COMMENT '上传人ID',
  `Function` enum('客厅','卧室','阳台','厨卫','其它') NOT NULL DEFAULT '其它' COMMENT '功能分类',
  `Size` int(11) unsigned NOT NULL COMMENT '大小(KB)',
  `Path` varchar(1000) NOT NULL COMMENT 'URL',
  `FlagShow` tinyint(4) NOT NULL DEFAULT '1' COMMENT '展示/不展示',
  `StaffID` char(32) DEFAULT NULL COMMENT '批注客服ID',
  `FlagDeleted` tinyint(1) DEFAULT NULL COMMENT '删除标志',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源图https://img.ekeae.com';

