/*Table structure for table `PropertyOwnerCerti` */

DROP TABLE IF EXISTS `PropertyOwnerCerti`;

CREATE TABLE `PropertyOwnerCerti` (
  `ID` char(32) NOT NULL COMMENT '租售->房源权属证明、委托授权书图片链接表',
  `PropertyID` char(32) NOT NULL COMMENT '房源ID',
  `Type` enum('代理委托书','物权证明','其它') NOT NULL,
  `Path` varchar(100) NOT NULL COMMENT '图片路径',
  `Time` datetime NOT NULL COMMENT '上传时间',
  `Status` enum('已核','待核') NOT NULL DEFAULT '待核' COMMENT '状态',
  `Remark` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源权属证明图片链接表';

/*Data for the table `PropertyOwnerCerti` */

/*Table structure for table `PropertyPre` */

DROP TABLE IF EXISTS `PropertyPre`;

CREATE TABLE `PropertyPre` (
  `ID` char(32) NOT NULL COMMENT '租售->客户房源预登记',
  `RegDate` datetime NOT NULL COMMENT '登记时间',
  `RegWay` enum('客户端','客服','其它') NOT NULL COMMENT '登记渠道',
  `EstateID` char(32) NOT NULL COMMENT '小区ID(非库存楼盘=32个0)',
  `Estate` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `Trade` enum('租','售') NOT NULL COMMENT '租售',
  `Status` enum('待分发','已分发') NOT NULL DEFAULT '待分发' COMMENT '状态',
  `Square` decimal(11,1) DEFAULT NULL COMMENT '面积',
  `Price` int(8) unsigned DEFAULT NULL COMMENT '报价',
  `CustID` char(32) DEFAULT NULL COMMENT '登记人ID（客户）',
  `Cust` varchar(20) DEFAULT NULL COMMENT '登记人',
  `CustTel` varchar(20) DEFAULT NULL COMMENT '登记人电话',
  `FlagSublet` tinyint(1) DEFAULT '0' COMMENT '分租标识',
  `FlagPay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否付佣0=未付拥1=已付拥',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK_P_ESTATE` (`EstateID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源预登记表';

