/*Table structure for table `PropertyPub` */

DROP TABLE IF EXISTS `PropertyPub`;

CREATE TABLE `PropertyPub` (
  `ID` char(32) NOT NULL COMMENT '租售->公盘',
  `PubTime` datetime DEFAULT NULL COMMENT '分发时间',
  `PropertyPreID` char(32) NOT NULL COMMENT '对应预登记房源ID',
  `PubType` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0=自动分发，1=人工分发',
  `EmpID` char(32) DEFAULT NULL COMMENT '经纪人ID',
  `EmpClaimTime` datetime DEFAULT NULL COMMENT '经纪人认领时间',
  `EmpClaimFlag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '经纪人是否认领0=否1=是',
  `Remark` varchar(50) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='公盘表';

