/*Table structure for table `PropertyScoreLog` */

DROP TABLE IF EXISTS `PropertyScoreLog`;

CREATE TABLE `PropertyScoreLog` (
  `ID` char(32) NOT NULL COMMENT '租售->房源积分明细',
  `PropertyID` char(32) NOT NULL COMMENT '房源ID',
  `Source` varchar(50) NOT NULL COMMENT '获分来源',
  `SourceItem` varchar(50) NOT NULL COMMENT '获分项目',
  `Score` int(3) NOT NULL COMMENT '分值',
  `CreateTime` date DEFAULT NULL COMMENT '时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `FK_FW_PRO` (`PropertyID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源跟进表';

