/*Table structure for table `PropertyView` */

DROP TABLE IF EXISTS `PropertyView`;

CREATE TABLE `PropertyView` (
  `ID` char(32) NOT NULL COMMENT '租售->房源查看(次数)',
  `PropertyID` char(32) NOT NULL COMMENT '房源ID',
  `CustID` char(32) NOT NULL DEFAULT '00000000000000000000000000000000' COMMENT '客户ID（未登录情况下=32个0）',
  `ViewType` enum('客户端','官网','其它') NOT NULL COMMENT '查看渠道',
  `ViewDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '查看时间',
  PRIMARY KEY (`ID`),
  KEY `FK_P_ESTATE` (`PropertyID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='房源查看(次数)表';

