/*Table structure for table `Property_bak` */

DROP TABLE IF EXISTS `Property_bak`;

CREATE TABLE `Property_bak` (
  `ID` char(32) NOT NULL COMMENT '租售->房源',
  `PropertyNo` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '房源编号',
  `EstateID` char(32) NOT NULL COMMENT '小区ID',
  `Estate` varchar(20) DEFAULT NULL COMMENT '小区名（辅助）',
  `Building` varchar(20) NOT NULL COMMENT '栋座',
  `Cell` varchar(20) NOT NULL COMMENT '单元',
  `RoomNo` varchar(20) NOT NULL COMMENT '房号',
  `Trade` enum('租','售') NOT NULL DEFAULT '租' COMMENT '交易',
  `Title` varchar(40) NOT NULL COMMENT '标题',
  `TitleModTime` datetime NOT NULL COMMENT '标题修改时间',
  `Status` enum('上架','下架','下架待核','异常') NOT NULL DEFAULT '上架' COMMENT '状态',
  `CountF` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '房',
  `CountT` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '厅',
  `CountW` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '卫',
  `CountC` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '厨',
  `CountY` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '阳',
  `Usage` enum('住宅','商住','办公') DEFAULT '住宅' COMMENT '物业用途',
  `Direction` enum('东','南','西','北','东北','西南','东南','西北','不详') NOT NULL DEFAULT '南' COMMENT '朝向',
  `Look` enum('有匙','业主','不详','其它') NOT NULL DEFAULT '有匙' COMMENT '看房方式',
  `Decoration` enum('毛坯','简装','精装','豪装') NOT NULL DEFAULT '精装' COMMENT '装修程度',
  `PropertyTax` enum('各付','实得','协商','包税','其它') NOT NULL DEFAULT '各付' COMMENT '税费说明',
  `Square` decimal(4,1) NOT NULL COMMENT '面积',
  `Price` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '售价/租金',
  `RegEmpID` char(32) DEFAULT NULL COMMENT '登记经纪人ID',
  `RegDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登记时间',
  `RegChannel` enum('经纪端','客户端','客服','推房99','小蜜书','推房神器','房客多','其它') NOT NULL COMMENT '登记渠道',
  `Feature` varchar(25) DEFAULT NULL COMMENT '房源特点(下划线隔开，最多4个，每个最多5字)',
  `CustID` char(32) DEFAULT NULL COMMENT '客户ID（业主直租情况下可用）',
  `OwnerName` varchar(10) DEFAULT NULL COMMENT '业主姓名',
  `OwnerMobile` varchar(50) DEFAULT NULL COMMENT '业主手机',
  `Floor` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '所在层',
  `FloorAll` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '总楼层',
  `EmpFollowID` char(32) DEFAULT NULL COMMENT '主获客经纪ID',
  `EmpFollowSay` varchar(300) DEFAULT NULL COMMENT '主获客经纪推荐词',
  `HeadImgPath` varchar(200) NOT NULL COMMENT '封面URL',
  `HeadImgModTime` datetime NOT NULL COMMENT '封面修改时间',
  `FlagSublet` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否分租',
  `SubletNumber` enum('1户','2户','3户','3户以上') DEFAULT '2户' COMMENT '(分租)几户合租',
  `SubletCondition` enum('男女均可','限女生') DEFAULT NULL COMMENT '(分租)条件',
  `SubletRoom` enum('主卧','次卧','其它') DEFAULT '主卧' COMMENT '(分租)房型',
  `Agent` enum('代理','直租','直租(押无犹)') NOT NULL DEFAULT '代理' COMMENT '委托',
  `FlagDeleted` tinyint(1) DEFAULT NULL COMMENT '删除标识',
  `DeletedTime` datetime DEFAULT NULL COMMENT '删除时间',
  `FeeRentCust` decimal(6,2) DEFAULT NULL COMMENT '客户佣金-租',
  `FeeSaleCust` double(6,2) DEFAULT NULL COMMENT '客户佣金-售',
  `FeatureModTime` datetime NOT NULL COMMENT '特点修改时间',
  `ViewTimes` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '查看次数（定时统计）',
  `ViewTimesFlash` datetime NOT NULL COMMENT '缺省为创建房源的时间',
  `Extra` varchar(200) NOT NULL DEFAULT '0' COMMENT '配套设施--电话,热水器,彩电,空调,冰箱,洗衣机,家具,床,宽带网,微波炉,衣柜,沙发,厨具（可做饭）,沙发独立卫生间',
  `Basic` varchar(200) NOT NULL DEFAULT '0' COMMENT '基础设施--水，电，煤气/天然气，有线电视，暖气，电梯，车位，露台，阁楼，储藏室/地下室',
  `SortScore` int(10) unsigned NOT NULL COMMENT '排序分数(排序依据)',
  `Remark` varchar(200) DEFAULT NULL COMMENT '业主其它联系方式等可以放在这里',
  PRIMARY KEY (`ID`),
  KEY `PropertyNo` (`PropertyNo`),
  KEY `FK_P_ESTATE` (`EstateID`),
  KEY `FK_P_EMPFOLLOW` (`EmpFollowID`),
  KEY `FK_P_CUST` (`CustID`)
) ENGINE=InnoDB AUTO_INCREMENT=11346779 DEFAULT CHARSET=utf8 COMMENT='房源表';

