/*Table structure for table `Proposal` */

DROP TABLE IF EXISTS `Proposal`;

CREATE TABLE `Proposal` (
  `ID` char(32) NOT NULL COMMENT '运营->建议',
  `ProposalNO` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '意见编号',
  `RevTime` datetime NOT NULL COMMENT '提交时间',
  `UserID` char(32) NOT NULL COMMENT '提交人ID',
  `Type` int(1) NOT NULL COMMENT '提交途径(0=官网1=经济移动端2客户移动端)',
  `Detail` varchar(200) NOT NULL COMMENT '建议内容',
  `DisposeStaff` varchar(32) DEFAULT NULL COMMENT '处理人',
  `DisposeOpinion` varchar(100) DEFAULT NULL COMMENT '处理意见',
  `DisposeTime` timestamp NULL DEFAULT NULL COMMENT '处理时间',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `ProposalNO` (`ProposalNO`)
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=utf8 COMMENT='意见建议表';

