/*Table structure for table `SecurityPolicy` */

DROP TABLE IF EXISTS `SecurityPolicy`;

CREATE TABLE `SecurityPolicy` (
  `ID` char(32) NOT NULL COMMENT '系统->安全策略',
  `PolicyTime` date NOT NULL COMMENT '使能时间',
  `Direction` enum('左','右') NOT NULL COMMENT '偏移方向',
  `Offset` int(2) unsigned NOT NULL COMMENT '偏移量',
  `SecretKey` char(3) NOT NULL COMMENT '密钥',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='安全策略表';

