/*Table structure for table `Staff` */

DROP TABLE IF EXISTS `Staff`;

CREATE TABLE `Staff` (
  `StaffID` char(32) NOT NULL COMMENT '伙伴->伙伴',
  `StaffNo` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '伙伴编号',
  `EName` varchar(20) NOT NULL COMMENT '英文名(登录)',
  `RName` varchar(10) DEFAULT NULL COMMENT '中文名(真实)',
  `DeptID` char(32) DEFAULT NULL COMMENT '部门ID(暂未启用)',
  `Password` char(32) NOT NULL COMMENT '登录密码',
  `Tel` char(11) DEFAULT NULL COMMENT '电话',
  `Status` enum('正常','冻结','异常') NOT NULL DEFAULT '正常' COMMENT '状态',
  `Position` enum('经理','职员','临时') NOT NULL DEFAULT '临时' COMMENT '岗位',
  `Power` int(2) NOT NULL DEFAULT '7' COMMENT '平台权限(最高级七级)',
  `Sex` enum('男','女','不详') NOT NULL DEFAULT '男' COMMENT '性别',
  `IDCard` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `Address` varchar(50) DEFAULT NULL COMMENT '家庭住址',
  `EMail` varchar(30) DEFAULT NULL COMMENT '注册邮箱',
  `Referee` varchar(10) DEFAULT NULL COMMENT '推荐人',
  `Icon` varchar(200) DEFAULT NULL COMMENT '用户头像URL',
  `LoginState` tinyint(1) DEFAULT '0' COMMENT '当前登录状态（1=已登录/0=未登录）',
  `LoginChange` datetime DEFAULT NULL COMMENT '登录切换时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`StaffID`),
  UNIQUE KEY `StaffNo` (`StaffNo`),
  UNIQUE KEY `EName` (`EName`)
) ENGINE=InnoDB AUTO_INCREMENT=75596156 DEFAULT CHARSET=utf8 COMMENT='伙伴表';

