/*Table structure for table `Town` */

DROP TABLE IF EXISTS `Town`;

CREATE TABLE `Town` (
  `ID` char(32) NOT NULL COMMENT '新房->新房',
  `Town` varchar(10) NOT NULL COMMENT '新房名',
  `CityID` char(32) DEFAULT NULL COMMENT '城市ID',
  `City` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `DistrictID` varchar(32) DEFAULT NULL COMMENT '区县ID',
  `District` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `AreaID` varchar(32) DEFAULT NULL COMMENT '片区ID',
  `Area` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `Sort` int(11) NOT NULL COMMENT '排序',
  `Status` int(2) NOT NULL DEFAULT '0' COMMENT '状态(0=展示1=下架)',
  `Longitude` varchar(20) DEFAULT NULL COMMENT '中心点经度',
  `Latitude` varchar(20) DEFAULT NULL COMMENT '中心点纬度',
  `Address` varchar(50) DEFAULT NULL COMMENT '地址(由经纬度生成)',
  `Price` int(6) NOT NULL DEFAULT '0' COMMENT '标注售价',
  `Feature` varchar(500) DEFAULT NULL COMMENT '特点ID，数组格式',
  `Show` date NOT NULL COMMENT '展示日期',
  `Layout` varchar(20) NOT NULL DEFAULT '两室一厅' COMMENT '户型',
  `HeadImg` varchar(200) DEFAULT NULL COMMENT '封面',
  `RegDate` date NOT NULL COMMENT '登记时间',
  `Contact` varchar(100) DEFAULT NULL COMMENT '驻场联系人',
  `ContactTel` char(11) DEFAULT NULL COMMENT '驻场联系人电话',
  `Open` date DEFAULT NULL COMMENT '开盘时间',
  `CooperationStart` date DEFAULT NULL COMMENT '合作期(开始)',
  `CooperationEnd` date DEFAULT NULL COMMENT '合作期(结束)',
  `CommissionBilling` int(2) NOT NULL DEFAULT '0' COMMENT '佣金结算类型(0=七天后佣)',
  `Traffic` varchar(100) DEFAULT NULL COMMENT '交通配套',
  `Education` varchar(100) DEFAULT NULL COMMENT '教育资源',
  `Medical` varchar(100) DEFAULT NULL COMMENT '医疗健康',
  `Entertainment` varchar(100) DEFAULT NULL COMMENT '生活娱乐',
  `HandOverDate` date DEFAULT NULL COMMENT '交房时间',
  `DevCompany` varchar(20) DEFAULT NULL COMMENT '开发商',
  `MgtCompany` varchar(20) DEFAULT NULL COMMENT '物业公司',
  `MgtTel` varchar(20) DEFAULT NULL COMMENT '售楼部电话',
  `Square` double(11,2) DEFAULT NULL COMMENT '总建筑面积',
  `Green` varchar(10) DEFAULT NULL COMMENT '绿化率',
  `Room` int(11) DEFAULT NULL COMMENT '总户数',
  `Park` int(11) DEFAULT NULL COMMENT '车位数',
  `AveragePrice` double(11,2) DEFAULT NULL COMMENT '均价',
  `MgtPrice` double(5,2) DEFAULT NULL COMMENT '物业费',
  `PropertyType` varchar(20) DEFAULT NULL COMMENT '建筑类型',
  `Decoration` varchar(20) DEFAULT NULL COMMENT '装修状态',
  `LandGrade` int(3) DEFAULT NULL COMMENT '产权年限',
  `TownType` int(2) NOT NULL DEFAULT '0' COMMENT '新盘类型(0=住房1=别墅2=商铺)',
  `ViewTimesFlash` datetime DEFAULT NULL COMMENT '查看次数更新时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`Sort`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新盘';

