/*Table structure for table `TownSection` */

DROP TABLE IF EXISTS `TownSection`;

CREATE TABLE `TownSection` (
  `ID` char(32) NOT NULL COMMENT '新房->经纪驻守新盘分时标段',
  `TownID` char(32) NOT NULL COMMENT '新盘ID',
  `Town` varchar(20) DEFAULT NULL COMMENT '（辅助）',
  `SectionDay` date NOT NULL COMMENT '标段日',
  `Morning` char(32) DEFAULT NULL COMMENT '6:00~12:00',
  `Middle` char(32) DEFAULT NULL COMMENT '12:00~18:00',
  `Night` char(32) DEFAULT NULL COMMENT '18:00~24:00',
  `Deputy1` char(32) DEFAULT NULL COMMENT '副获客经纪1',
  `Deputy2` char(32) DEFAULT NULL COMMENT '副获客经纪2',
  `Deputy3` char(32) DEFAULT NULL COMMENT '副获客经纪3',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='经纪驻守新盘分时标段';

/*Data for the table `TownSection` */

/*Table structure for table `TownSectionHand` */

DROP TABLE IF EXISTS `TownSectionHand`;

CREATE TABLE `TownSectionHand` (
  `ID` char(32) NOT NULL COMMENT '新房->经纪竞拍新盘首席获客经纪表(冻结积分池)',
  `TownSectionID` char(32) NOT NULL COMMENT '标段ID',
  `EmpID` char(32) NOT NULL COMMENT '经纪ID',
  `ActType` enum('扣除','解冻','冻结') NOT NULL COMMENT '发生方式',
  `ActTime` datetime NOT NULL COMMENT '动作时间',
  `ActScore` int(2) NOT NULL COMMENT '动作分数',
  `Score` int(2) NOT NULL COMMENT '动作后累计冻结分数',
  `Content` varchar(100) NOT NULL COMMENT '内容(记录明细)',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `EnterpriseNo` (`ActTime`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='经纪竞拍新盘首席获客经纪表(冻结积分池)';

/*Data for the table `TownSectionHand` */

/*Table structure for table `TownStorage` */

DROP TABLE IF EXISTS `TownStorage`;

CREATE TABLE `TownStorage` (
  `ID` char(32) NOT NULL COMMENT '新房->新房（储存）',
  `TownStorageName` varchar(10) NOT NULL COMMENT '新房名（储存）',
  `City` varchar(10) NOT NULL COMMENT '城市',
  `District` varchar(10) DEFAULT NULL COMMENT '区县',
  `RegDate` date NOT NULL COMMENT '登记时间',
  `Price` int(6) NOT NULL DEFAULT '0' COMMENT '标注售价',
  `Status` enum('前期','商洽','签约') NOT NULL DEFAULT '前期' COMMENT '状态',
  `Address` varchar(50) NOT NULL COMMENT '地址',
  `Show` date NOT NULL COMMENT '展示日期',
  `Open` date DEFAULT NULL COMMENT '开盘时间',
  `HandOverDate` varchar(20) DEFAULT NULL COMMENT '交房时间',
  `DevCompany` varchar(20) DEFAULT NULL COMMENT '开发商',
  `MgtTel` varchar(20) DEFAULT NULL COMMENT '售楼部电话',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新盘';

/*Data for the table `TownStorage` */

/*Table structure for table `TownStorageLog` */

DROP TABLE IF EXISTS `TownStorageLog`;

CREATE TABLE `TownStorageLog` (
  `ID` char(32) NOT NULL COMMENT '新房->新房（储存）商洽日志',
  `TownStorage` varchar(10) NOT NULL COMMENT '新房名（储存）',
  `Status` enum('跟进') NOT NULL DEFAULT '跟进' COMMENT '状态',
  `City` varchar(10) NOT NULL COMMENT '城市',
  `District` varchar(10) DEFAULT NULL COMMENT '区县',
  `RegDate` date NOT NULL COMMENT '登记时间',
  `Note` varchar(200) DEFAULT NULL COMMENT '日志内容',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新盘';

/*Data for the table `TownStorageLog` */

/*Table structure for table `TownView` */

DROP TABLE IF EXISTS `TownView`;

CREATE TABLE `TownView` (
  `ID` char(32) NOT NULL COMMENT '新房->新盘查看(次数)',
  `TownID` char(32) DEFAULT NULL COMMENT '新盘ID',
  `Town` varchar(20) DEFAULT NULL,
  `CustID` char(32) NOT NULL DEFAULT '00000000000000000000000000000000' COMMENT '客户ID（未登录情况下=32个0）',
  `ViewType` enum('客户端','官网','其它') NOT NULL COMMENT '查看渠道',
  `Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '查看时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新盘查看(次数)表';

/*Data for the table `TownView` */

/*Table structure for table `VerApp` */

DROP TABLE IF EXISTS `VerApp`;

CREATE TABLE `VerApp` (
  `ID` char(32) NOT NULL COMMENT '系统->APP版本日志',
  `Release` datetime NOT NULL COMMENT '发布时间',
  `App` enum('经纪移动端','客户移动端') NOT NULL COMMENT '应用',
  `Ver` varchar(10) NOT NULL COMMENT '版本号(6.0.12)',
  `ModLog` varchar(200) NOT NULL COMMENT '更新内容',
  `Android` varchar(100) DEFAULT NULL COMMENT '安卓下载地址',
  `IPhone` varchar(100) DEFAULT NULL COMMENT '苹果下载地址',
  `Remark` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='APP版本日志';

/*Data for the table `VerApp` */

/*Table structure for table `WebSite` */

DROP TABLE IF EXISTS `WebSite`;

CREATE TABLE `WebSite` (
  `ID` varchar(32) NOT NULL COMMENT '网站表',
  `WebName` varchar(20) NOT NULL COMMENT '网站名称',
  `LogoUrl` varchar(1000) NOT NULL COMMENT 'Logo图片的URL',
  `LoginUrl` varchar(200) NOT NULL COMMENT '网站登录URL',
  `RegisterUrl` varchar(200) NOT NULL COMMENT '网站注册URL',
  `Refresh` int(1) NOT NULL DEFAULT '0' COMMENT '是否可以刷新(0=否1=是)',
  `Release` int(1) NOT NULL DEFAULT '0' COMMENT '是否可以发布(0=否1=是)',
  `Charge` int(1) NOT NULL DEFAULT '0' COMMENT '是否收费(0=否1=是)',
  `Sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序字段',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

